INSERT INTO `Survey_Infos` VALUES (1,'brian.adams@army.mil',1,'Knowledge Check','/images/default_imgs/img3.png','H2F is designed to optimize Soldier personal readiness,  reduce injury rates, improve rehabilitation after injury, and increase the overall effectiveness of the Total Army. These assessment tools are designed to help you identify your strengths   and weaknesses in the areas of Holistic Health and Fitness and must be completed by all members of the Army National Guard along with the PHA.',0,NULL,0,1),(2,'brian.adams@army.mil',1,'Cognitive Performance','/images/default_imgs/img1.png','The Cognitive Performance Assessment of the Army National Guard is a comprehensive tool designed to holistically evaluate a service member\'s well-being, encompassing various domains of health and fitness. ',0,NULL,0,1),(3,'brian.adams@army.mil',1,'Movement Screening','/images/default_imgs/img2.png','The  Movement Screening is an assessment   tool used by the Army National Guard to evaluate the fundamental movement patterns of its service members. It is designed to identify functional limitations and asymmetries in the body which can increase    the risk of injury. The FMS consists of a series of specific exercises that challenge an individual\'s ability to perform basic movement patterns without compensation. Each exercise is scored on a scale, and     the results provide valuable feedback about an individual\'s movement quality. The scores can then guide targeted training and corrective exercises, helping to reduce the potential for injury and improve overall     physical performance. This systematic approach is vital for ensuring the readiness and resilience of the troops in the ever-demanding physical environments they encounter.',1,'1234',0,1);
